import React from 'react';
import { links } from './data';

const Sidebar = () => {

  const displayLinks = links.map(link => {
    const { id, url, text } = link;
    return (
      <li key={id}>
        <a href={url}>{text}</a>
      </li>
    )
  });

  return (
    <>
      <h4>Sidebar</h4>
      <div className='links-container show-container'>
        <ul className='links'>
          { displayLinks }
        </ul>
      </div>
    </>
  )
}

export default Sidebar;
